import React, { useState, useEffect, useRef } from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import axios from "axios";
import Lottie from "lottie-react";
import loadingAnimation from "./assets/loading.json";
import about_me_pic from "./assets/about_me_pic.png";
import bot_icon from "./assets/bot_icon.jpg";
import TermsOfUse from "./TermsOfUse";
import PrivacyPolicy from "./PrivacyPolicy";

const API_URL = "https://opv17qccr5.execute-api.us-east-1.amazonaws.com/dev/invoke-agent";

// Define initial static styles
const staticStyles = {
    container: { textAlign: "center", fontFamily: "Arial", margin: "auto", position: "relative" },
    footer: { marginTop: "20px", padding: "10px", fontSize: "14px" },
    footerLink: { color: "#007bff", textDecoration: "none", margin: "0 10px" },
};

function ChatApp() {
    const [prompt, setPrompt] = useState("");
    const [messages, setMessages] = useState([
        { text: "Hi there! Welcome to Ask Me Bot!", sender: "bot" }
    ]);
    const [loading, setLoading] = useState(false);
    const chatEndRef = useRef(null);

    const handleSend = async () => {
        if (!prompt.trim()) return;

        const userMessage = { text: prompt, sender: "user" };
        setMessages((prev) => [...prev, userMessage]);
        setPrompt("");
        setLoading(true);

        try {
            const res = await axios.post(API_URL, { prompt }, { headers: { "Content-Type": "application/json" } });
            setMessages((prev) => [...prev, { text: res.data.response, sender: "bot" }]);
        } catch (error) {
            setMessages((prev) => [...prev, { text: "Error occurred.", sender: "bot" }]);
        }

        setLoading(false);
    };

    useEffect(() => {
        chatEndRef.current?.scrollIntoView({ behavior: "smooth" });
    }, [messages]);

    return (
        <div style={staticStyles.container}>
            <a href="https://shuseiyokoi.notion.site/?pvs=4" target="_blank" rel="noopener noreferrer">
                About Me
                <img src={about_me_pic} alt="About Me" style={{ width: "24px", height: "24px", borderRadius: "50%", marginLeft: "8px" }} />
            </a>
            <h2>Ask Me</h2>
            <div>
                {messages.map((msg, index) => (
                    <div key={index} style={{ textAlign: msg.sender === "user" ? "right" : "left" }}>
                        <p style={{ display: "inline-block", padding: "10px", borderRadius: "10px", backgroundColor: msg.sender === "user" ? "#009DB4" : "#e5e5ea", color: msg.sender === "user" ? "white" : "black" }}>
                            {msg.text}
                        </p>
                    </div>
                ))}
                <div ref={chatEndRef} />
            </div>
            <textarea value={prompt} onChange={(e) => setPrompt(e.target.value)} placeholder="Ask me anything!" />
            <button onClick={handleSend} disabled={loading}>{loading ? "Thinking..." : "Send"}</button>

            {/* Footer Links */}
            <div style={staticStyles.footer}>
                <Link to="/terms" style={staticStyles.footerLink}>Terms of Use</Link>
                <Link to="/privacy" style={staticStyles.footerLink}>Privacy Policy</Link>
            </div>
        </div>
    );
}

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<ChatApp />} />
                <Route path="/terms" element={<TermsOfUse />} />
                <Route path="/privacy" element={<PrivacyPolicy />} />
            </Routes>
        </Router>
    );
}

export default App;
